import React from 'react'
import {ButtonBase} from '@material-ui/core'
import {useStyles} from "./useStyle"

type ButtonProps<T> = {
    className?: 'string',
    [T]
}

export const ButtonComponent = ({className, ...props}: ButtonProps) => {
    const classes = useStyles();

    return (
        <ButtonBase className={`${classes.root} ${className}`} {...props}>
            {props.children}
        </ButtonBase>
    )
};
